import logo from '../media/logo_colored.svg';
import './Heading.css'
const Heading = () => {
    return (
        <div id="header-container" class=" border row space-around">
            <div id="branding" class="border col-xl-4 col-lg-5  col-sm-12">
                <figure>
                    <img src={logo} alt="Logo"></img>
                    <figcaption class="invisible">Weboldal log√≥</figcaption>
                </figure>
                <h1>{window.BRAND_FULL_NAME}</h1>
            </div>
            <div id="slogan" class="border col-xl-4 col-lg-5 col-sm-12">
                <h2 class="initiale">{window.BRAND_SLOGAN}</h2>
            </div>
        </div>
    )
};

export default Heading;
